ange `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"632200","type":"CustomJS"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","line_width":1.3,"x":{"field":"index"},"y":{"field":"rsi(C,14)_0_1"}},"id":"632137","type":"Line"},{"attributes":{"data":{"Close":{"__ndarray__":"7FG4HoULREDT9NkB1yNEQEGDTZ1HoUNAluoCXmamQ0CCPLt86xFEQAAAAAAAIERAQYNNnUdBRECCPLt861FEQEGDTZ1HYURAFK5H4Xq0REAAAAAAAKBEQFUxlX7CdURAVTGVfsJVREC/fLJiuD5EQBSuR+F6FERALQsm/igcREDXo3A9CjdEQJbqAl5mRkRA7FG4HoULREBBg02dR6FDQAAAAAAAQENAVTGVfsL1QkBVZ7XAHkVDQC0LJv4oHENAKVyPwvUIQ0DsUbgehUtDQBhd3hyuZ0NAluoCXmZGQ0B+w0SDFC5DQL98smK43kJA1Cr6QzMTQ0C/fLJiuP5CQKuYSj/h+kJAw/UoXI8CQ0B+w0SDFC5DQCzVBbzMLENALNUFvMwsQ0C/RpIgXC9DQOxRuB6Fy0JAVTGVfsLVQkBqFf2hmXlCQEGDTZ1HYUJAGF3eHK5nQkDUKvpDM1NCQD0K16NwXUJAq85qgT2qQkAs1QW8zMxCQBhd3hyu50JAKVyPwvXoQkB+w0SDFI5CQEG5bd+jcEJA1Cr6QzNTQkC/fLJiuF5CQC0LJv4o/EFALQsm/ijcQUDT9NkB16NBQBSuR+F69EFAVTGVfsL1QUC/fLJiuN5BQEGDTZ1HoUFAAAAAAACgQUCW6gJeZsZBQEGDTZ1H4UFAfsNEgxQOQkBqFf2hmTlCQL9GkiBcb0JAGF3eHK6HQkDUKvpDM9NCQEGDTZ1H4UJAv0aSIFzvQkC/RpIgXM9CQBSuR+F6tEJAAAAAAAAgQ0CrzmqBPQpDQMP1KFyPIkNA7FG4HoXLQkBBuW3fo/BCQEG5bd+jEENAv0aSIFwPQ0CW6gJeZkZDQMP1KFyPYkNAq85qgT1KQ0AtCyb+KHxDQKvOaoE9qkNA0/TZAddDREBVMZV+wrVEQGoV/aGZuURAv3yyYrjeRECrmEo/4bpEQAAAAAAAoERAKVyPwvUoREDUKvpDM9NDQGoV/aGZ2UNAfsNEgxQORECW6gJeZiZEQBSuR+F6VERAVTGVfsJ1REApXI/C9YhEQBSuR+F6VERA16NwPQpXREDsUbgehYtEQCzVBbzM7ERAVTGVfsLVREDsUbgehetEQOxRuB6F60RAQblt36PwREBVMZV+wrVEQGoV/aGZ+URAgjy7fOsRRUBVMZV+wjVFQNejcD0Kl0VAVWe1wB5l
